This is the documentation for
https://docs.npmjs.com/.

This repository contains the
content for our documentation site, and the GitHub Actions workflows
that generate the site itself.

Quick start

npm install to download gatsby, our theme, and the dependencies

npm run develop: starts the test server at http://localhost:8000.

Update the content - it's Mdx, which is like markdown - in the content
directory.

Review your content at http://localhost:8000. (Gatsby watches the
filesystem and will reload your content changes immediately.)

Once you're happy, commit it and open a pull request at
https://github.com/npm/documentation.

A CI workflow run will publish your PR to a GitHub Preview Page.

Once the content is reviewed, merge the pull request. That will
deploy the site.

Do you want to know more? Check out our contributing guide.

Theme

The gatsby theme used here is "doctornpm" - a variation of
doctocat with some theme changes
for npm's design language and additional components to support multiple
versions of the CLI documentation.

